import Movies from "./Movies";
import React, { useEffect, useState } from "react";

function Rated_Movies() {
    const [movies, setMovies] = useState([]);

    useEffect(() => {
        fetch("/rated_movies").then(response =>
            response.json().then(data => {
                setMovies(data.movies);
            })
